sources.scss/_resume.scss:
#resume{
    .info-section{
        width: 20%;
    }

    .content-area{
        margin-left: 20%;
        width: 80%;
        background: blue; //$color3;
        min-width: 300px;
        height: 100%; 
        overflow: hidden;
        background: blue; //$color3;
    }

    .category{
        margin-bottom: 56px;

        h1{
            font-weight: 700;
            font-size: 2rem;
            text-transform: uppercase;
            margin-bottom: 56px;
        }

        .xp-section{
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-column-gap: 56px;
            grid-row-gap: 30px;
            max-width: 1000px;

            .xp-box{
                padding: 30px;
                transition: all 0.5s ease-in-out;
                &:hover{
                    -webkit-box-shadow: 0px 20px 74px 6px rgba(0,0,0,0.12);
                    -moz-box-shadow: 0px 20px 74px 6px rgba(0,0,0,0.12);
                    box-shadow: 0px 20px 74px 6px rgba(0,0,0,0.12);
                }


                h5{
                    font-weight: 600;
                    font-size: 1.3rem;
                    margin-bottom: 1.4rem;
                }

                p{
                    font-weight: 300;
                    font-size: 1rem; 
                    margin-bottom: 1rem;
                }
            }
        }
    }
}

//phone
@media (min-width: 0px) and (max-width: 767px){
    html, body{
        height: auto;
    }

    #resume{
        .menu-icon{
            top: -3px;
            right: 20px;
            color: white;

            .fa{
                color: white;
            }
        }

        .info-section{
            padding: 10px 30px;
            position: static;
            border: 3px solid red;
            .logo{
                height: 50px;
                width: 70px;
                font-size: 1rem;
            }

            .info-box{
                display: none;
            }
        }

        .content-area{
            border: 3px solid black;
            // margin-left: 0;
            margin-right: 30%;
            width: 100%;
            height: auto !important;


            &:after{
                content: "";
                display: table;
                clear: both;
            }
            .scroll-section{
                padding: 50px 20px;
                width: 100%;
                height: auto;
                overflow: auto;
            }
            .category{
                width: 100%;
                .xp-section{
                    grid-template-columns: 1fr;

                }
            }

        }
    }
}
